import 'bootstrap/dist/css/bootstrap.min.css';

function AboutPage() {
  return (
    <div className="container">
      <h1 className="mt-5 mb-4">About Page</h1>
      <p className="lead">Learn more about me and my website.</p>
    </div>
  );
}

export default AboutPage;
